import PropTypes from "prop-types";
import React from "react";
const leftArrow = "<";

function Pagination(props) {
    const currentPage = this.props.pagination.page;
    const lastPage = this.props.pagination.last;

    if (lastPage === 1) {
        return null;
    }
    if(lastPage === currentPage) {
        return (
            <React.Fragment>
                <button onClick={this.props.firstPage}> 1 </button>
                <button onClick={this.props.lastPage}> {leftArrow} </button>
                <button disabled> {currentPage} </button>
            </React.Fragment>
        )
    } else if (currentPage === 1 && lastPage !== 1) {
        return (
            <React.Fragment>
                <button disabled> 1 </button>
                <button onClick={this.props.nextPage}> > </button>
                <button onClick={this.props.lastPage}> {lastPage} </button>
            </React.Fragment>
        )
    } else if (currentPage === 2) {
        return (
            <React.Fragment>
                <button onClick={this.props.firstPage}> 1 </button>
                <button disabled> 2 </button>
                <button onClick={this.props.nextPage}> > </button>
                <button onClick={this.props.lastPage}> {lastPage} </button>
            </React.Fragment>
        )
    } else if (lastPage === 2 && currentPage === 2) {
        return (
            <React.Fragment>
                <button onClick={this.props.firstPage}> 1 </button>
                <button disabled> 2 </button>
            </React.Fragment>);
    } else if (lastPage === 2 && currentPage === 1) {
        return (
            <React.Fragment>
                <button disabled > 1 </button>
                <button onClick={this.props.lastPage}> 2 </button>
            </React.Fragment>);
    }
    return (
        <React.Fragment>
            <button onClick={this.props.firstPage}> 1 </button>
            <button onClick={this.props.previousPage}> {leftArrow} </button>
            <button disabled> {currentPage} </button>
            <button onClick={this.props.nextPage}> > </button>
            <button onClick={this.props.lastPage}> {lastPage} </button>
        </React.Fragment>);
}


export default { Pagination };

Pagination.propTypes = {
    pagination: PropTypes.any,
    nextPage: PropTypes.func,
    previousPage: PropTypes.func.isRequired,
    firstPage: PropTypes.func.isRequired,
    lastPage: PropTypes.func.isRequired
};
